import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';

import SideNavigation from './components/sidenav';// Import SideNavigation component
import StudentDashboard from './components/studash'; // Import StudentDashboard component


const App = () => {
  // For simplicity, we can assume authentication status here (in a real app, use state or context)
  // const isAuthenticated = true;

  // Protected Route wrapper for pages that require authentication
  // const PrivateRoute = ({ children }) => {
  //   return isAuthenticated ? children : <Navigate to="/login" />;
  // };

  return (
    <Router>
      <div className="flex min-h-screen">
        {/* Render SideNavigation for all authenticated pages */}
        {/* {isAuthenticated && (
          <div className="w-[15%]">
          </div>
        )} */}
            <SideNavigation />

        {/* Main Content Area */}
        <div className="flex-1">
          <Routes>
            {/* Public Route for Login */}
            {/* <Route path="/login" element={<Login />} /> */}

            {/* Protected Routes */}
            <Route
              path="*"
              element={

                  <Routes>
                    <Route path="/dashboard" element={<StudentDashboard />} />

                  </Routes>

              }
            />
          </Routes>
        </div>
      </div>
    </Router>
  );
};

export default App;
